import React from 'react';
import './DetailsList.css';

const DetailsList = ({ title,
    image,
    details = [],
    backgroundColor = '#fff',
    width = '300px',
    display = 'flex',
    justifyContent ,
    alignItems,
    children }) => {


    return (
        <div className="simple-car" style={{ backgroundColor, width ,display,justifyContent,alignItems}}>
            <div className="card-hea">
                {image && <img src={image} alt={title} className="card-ima" />}
                <h3 className="card-tit">{title}</h3>
            </div>
            <div className="card-bod">
                {details.map((detail, index) => (
                    <p key={index} className="card-det">{detail}</p>
                ))}
                {children && <div className="custom-con">{children}</div>}
            </div>
        </div>
    );
};



export default DetailsList;
